import React from "react";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  svgHover: {
    fill: theme.palette.foreground.default,
    "&:hover": {
      fill: theme.palette.primary.main,
    },
    transition: "all 0.5s ease",
  },
}));

export const Logo = () => {
  const classes = useStyles();

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 150 150" // Reduzi a área de visualização para tornar as letras menores
      className={classes.svgHover}
    >
      <g id="Layer_2" data-name="Layer 2">
        <g id="Layer_5" data-name="Layer 5">
          {/* Letra R menor */}
          <rect className="cls-1" x="20" y="50" width="15" height="50" rx="5" />
          <rect className="cls-1" x="20" y="50" width="60" height="15" rx="5" />
          <rect className="cls-1" x="50" y="80" width="15" height="30" rx="5" />
          <rect className="cls-1" x="20" y="110" width="40" height="15" rx="5" />

          {/* Letra P menor */}
          <rect className="cls-1" x="80" y="50" width="15" height="50" rx="5" />
          <rect className="cls-1" x="80" y="50" width="45" height="15" rx="5" />
          <rect className="cls-1" x="110" y="80" width="15" height="30" rx="5" />
          <rect className="cls-1" x="80" y="110" width="45" height="15" rx="5" />
        </g>
      </g>
    </svg>
  );
};
